import React from "react";

//Material UI
import { Typography, Grid } from "@material-ui/core";

const Footer = () => {
  return (
    <Grid
      container
      direction="row"
      justify="space-between"
      alignItems="center"
      xs={12}
    >
      <Grid item xs={11} md={3}>
        About Us
      </Grid>
      <Grid item xs={11} md={4}>
        Find Us
      </Grid>
      <Grid item xs={11} md={3}>
        Socials
      </Grid>
    </Grid>
  );
};

export default Footer;
